import React from 'react';

export default function LoadingBox() {
  return (
    <div className="loading">
      <button>
      <span
    class="spinner-border spinner-border-sm"
    role="status"
    aria-hidden="true"
  ></span>
  Loading...

      </button>
      <i className="fa spinner-grow spinner-grow-sm" role='state' aria-hidden= 'true'></i> Loading...
    </div>
  );
}
